import React from 'react';
import styled from 'styled-components';

const UserGridStyled = styled.div`
  display: grid;
  justify-content: center;
  margin-top: 80px;
  margin- bottom: 50px;
`

export default function() {
  return <UserGridStyled> UserGrid </UserGridStyled>
}
